class Solution:
    def checkPalindromeFormation(self, a: str, b: str) -> bool:
        
        def isp(s):
            return all(s[i] == s[len(s)-i-1] for i in range(len(s)//2))
        
        if isp(a) or isp(b):
            return True
        
        def check(a, b):
            ia, ib = 0, len(b)-1
            
            while ia < ib:
                if a[ia] != b[ib]:
                    return isp(b[ia:ib+1]) or isp(a[ia: ib+1])
                ia += 1
                ib -= 1

            return True
        
        return check(a, b) or check(b, a)


if __name__ == '__main__':
    s = Solution()
    print(s.checkPalindromeFormation("abdef", "fecab"))
    print(s.checkPalindromeFormation('x', 'y'))
